import React, { Component } from "react";
import styled from "styled-components";

const Container = styled.div`
  /* display: flex; */
`;

const Form = styled.form`
    /* display: flex; */
    /* flex-direction: column; */
`;

const Input = styled.tr`
    /* display: flex; */
`;

class SignupPage extends Component {
    render() {
        return(
            <Container>
                <Form action="">
                    <Input>
                        <label htmlFor="username">Full Name</label>
                        <input type="text" name="username" placeholder="Enter Full Name" id="username" />
                    </Input>
                    <Input>
                        <label htmlFor="email">Email</label>
                        <input type="text" name="email" placeholder="Enter Email ID" id="email" />
                    </Input>
                    <Input>
                        <label htmlFor="phone">Phone</label>
                        <input type="text" name="phone" placeholder="Enter Phone number" id="phone" />
                    </Input>
                    <Input>
                        <label htmlFor="password">Password</label>
                        <input type="text" name="password" placeholder="Enter Password" id="password" />
                    </Input>
                </Form>
            </Container>
        )
    }
}

export default SignupPage;
